/* Lib */
import cx from 'classnames';
import { useEffect } from 'react';

/* Components */
import Dropdown from './components/dropdown';

const Index = () => {

    useEffect(() => {
        fetch('/api/users')
            .then(res => res.json())
            .then(
                (r) => {
                    console.log(r);
            }
        )
    })

    let list = [1, 2, 3, 4]
    let sim = [{ value: 1, description: 'Euclidean' }, { value: 2, description: 'Pearson Colleration' }];

    return (
        <div className={cx(['container'], ['m-5'])}>
            <div className={cx(['row'])}>
                <div className={cx(['col-sm'])}>
                    <Dropdown defaultText={'Select user'} list={list} />
                </div>
                <div className={cx(['col-sm'])}>
                    <select className="custom-select">
                        {sim.map((x: any, i: number) => <option value={i} key={i}>{x.description}</option>)}
                    </select>
                </div>
            </div>
        </div>
    )
};

export default Index;
